import Dishes from "../../components/dishes";
import { useRouter } from "next/router";
import {
  ApolloProvider,
  ApolloClient,
  HttpLink,
  InMemoryCache,
} from "@apollo/client";

export default function Restaurant() {
  const router = useRouter();

  const renderDishes = (restaurantID) => {
    return <Dishes restId={restaurantID}> </Dishes>;
  };

  return (
    <>
      <div>{router.query.restaurant}</div>

      <div>{renderDishes(restaurantID)}</div>
    </>
  );
}

export async function getStaticPaths() {
  const GET_PAGE_DISHES = gql`
    query ($id: ID!) {
      restaurant(id: $id) {
        id
        name
        dishes {
          id
          name
          description
          price
          image {
            url
          }
        }
      }
    }
  `;
  return {
    paths: [],
  };
}
